$(window).load( function() {
  create_image();
});

function create_image() {
  $.ajax({
    url: '/ajax',
    dataType: 'json',
    type:'POST',
    error: function(xhr) {
      // alert(xhr);
    },
    success: function(response) {
      var c = document.getElementById("content-canvas");
      var ctx = c.getContext("2d");
      var number = response.length;
      var distance_x = 25;
      var words_array = [];
      var counter = 1;
      var words_line = "";

      rows = parseInt(number / 33) + 1;
      canvas_height = rows * 45 + 55;

      create_background(c, canvas_height);
      for( var index in response ) {
        words_line = words_line + response[index] + " ";
        counter++;
        if ( response[index] == response[response.length - 1]) {
          words_array.push(words_line);
        }

        if( counter == 34 ) {
          words_array.push(words_line);
          counter = 1;
          words_line = "";
        }
      }
      ctx.font = "20px Arial";
      console.log(words_array);
      for( var index = 0 ; index < words_array.length ; index++ ) {
        ctx.fillText(words_array[index], distance_x, 55 + 45 * index);
      }
      // ctx.fillText("我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我 我", distance_x, 55);
    }
  });
}

function create_background(c, height) {
  c.height = height
}
